import React from "react";
import { BrowserRouter, Route } from 'react-router-dom';
import Home from "./components/Home"

class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
        <Route path="/">
          <Home />
        </Route>
      </BrowserRouter>
    );
  }
}

export default App;
